/* component and style */
import Container from "../components/Container";
import styles from "../views/MyGallery.module.scss";
export default function MyGallery(props) {
    return (
        <Container secundContainer={true}>
            {props.oneMachine.gallery.map((photo) => {
                return (
                    <p>{photo.photo}</p>
                )
            })}
        </Container>
    )
}
